import React from 'react';
import { IoIosArrowDropleft } from 'react-icons/io';

function Sidebar() {
    return (
        <>
        <div className="Sidebar">
         <nav className = {sidebar ? 'nav active' : 'nav'}>
             <ul className = 'nav-itmes'>
                 <li className='nav-toggle'>
                 <IoIosArrowDropleft />
                 </li>
             </ul>
         </nav>
        </div>
        </>
    )
}

export default Sidebar;
